import React, { Component } from 'react';

class PlaylistItem extends Component {
    render() {
        return (
            <div>
                <li className="list-group-item">
                <div className="row">
                    <div className="col-4">
                        <img src={this.props.videoThumbnail} alt="" style={{height:"56px"}}/>
                    </div>
                    <div className="col">
        <p style={{width: "200px", height:"30px",textOverflow: "ellipsis",overflow:"hidden"}}>{this.props.videoTitle}</p>
                    </div>
                </div>
                </li>
                
            </div>
        );
    }
}

export default PlaylistItem;
